var CompensationEntryModel = Backbone.Model.extend({
	defaults: {
		url : { female : '/api/compensation_entry/female' ,
				precision: '/api/compensation_entry/precision',
				gcm: '/api/compensation_entry/gcm',
				confirm: '/api/compensation_entry/confirm'}
	},
	vars : {
		confirm_data		: ""
	},

	sync : {
		female:{
			purchase_day:"2013-10-25"
			,contract_no:"13102500004"
			,type:"1"
			,encouragement_no:"PF20131101000000011"
			,address:"東京都千代田区１－１－１"
			,postalcode:"1000001"
			,tel:"09011111111"
			,visit_day:"2013-10-26"
			,visit_family:"1"
			,hospital:"東大分院"
			,reason:"理由？"
			,public_insurance:"1"
			,first_visit:"1"
				,prescription:""
			},
		precision:{
			purchase_day:"2013-10-25"
			,contract_no:"13102500004"
			,type:"2"
			,encouragement_no:"PF20131101000000011"
			,address:"東京都千代田区１－１－１"
			,postalcode:"1000001"
			,tel:"09011111111"
			,visit_day:"2013-10-26"
			,visit_family:"1"
			,hospital:"東大分院"
			,doubt_symptom:"1"
			,public_insurance:"1"
			,precision_kind:"1"
					,specification_practice:""
			},
		contract_no:"13102500004"
		},

	func		:"",

	flag		:{

	},

	loadServer : function(){

		console.log( "CompensationEntryModel..." );
		var that = this;

		if(that.func=='female'){

			that.loadServer_female();

		}else if(that.func=='precision'){

			that.loadServer_precision();

		}else if(that.func=='gcm'){

			that.loadServer_gcm();

		}else if(that.func=='confirm'){

			that.loadServer_confirm();
		}

	},

	loadServer_female :function(){
		var that = this;
		$.ajax({
			cache : false,
			type : 'POST',
			contentType : 'application/json',
			data : JSON.stringify(that.sync.female),
			dataType: 'json',
			url   : that.defaults.url.female,
			success: function(res){
				console.log( res );
				if(res.result == 'OK'){
					that.trigger( 'completeServer' );
				}else{
					alert('入力エラー');
					that.trigger( 'error' );
				}
			}
		});
	},
	loadServer_precision :function(){
		var that = this;
		$.ajax({
			cache : false,
			type : 'POST',
			contentType : 'application/json',
			data : JSON.stringify(that.sync.precision),
			dataType: 'json',
			url   : that.defaults.url.precision,
			success: function(res){
				console.log( res );
				if(res.result == 'OK'){
					that.trigger( 'completeServer' );
				}else{
					alert('入力エラー');
					that.trigger( 'error' );
				}
			}
		});
	},
	loadServer_gcm :function(){

		var that = this;
		$.ajax({
			cache : false,
			type : 'POST',
			data : {"contract_no":that.sync.contract_no},
			dataType: 'json',
			url   : that.defaults.url.gcm,
			success: function(res){
				console.log( res );
				if(res.result == 'OK'){
					that.trigger( 'completeServer' );
				}else{
					alert('入力エラー');
					that.trigger( 'error' );
				}
			}
		});
	},

	loadServer_confirm :function(){
		var that = this;
		$.ajax({
			cache : false,
			type : 'POST',
			data : {"contract_no":that.sync.contract_no},
			dataType: 'json',
			url   : that.defaults.url.confirm,
			success: function(res){
				console.log( res );
				if(res.result == 'OK'){
					that.vars.confirm_data	= res.data.datas;
					that.trigger( 'completeServer' );
				}else{
					alert('入力エラー');
					that.trigger( 'error' );
				}
			}
		});
	}
});
